DROP TABLE IF EXISTS gdm_gis_device CASCADE;

CREATE TABLE gdm_gis_device (
    id character varying(50),
    code character varying(50) NOT NULL,
    type character varying(50) NOT NULL,
    is_gps boolean NOT NULL,
    lon double precision NOT NULL,
    lat double precision NOT NULL,
    speed numeric(5,0) NOT NULL,
    angle numeric(3,0) NOT NULL,
    altitude numeric(3,0) NOT NULL,
    gps_time timestamp(6) without time zone NOT NULL,
    receive_time timestamp(6) without time zone NOT NULL,
    save_time timestamp(6) without time zone NOT NULL,
    operator character varying(50) NOT NULL,
    valid numeric(1,0) DEFAULT 1,
    create_time bigint NOT NULL,
    update_time bigint NOT NULL,
    geom geometry(Point,4326) NOT NULL,
    coords text NOT NULL,
    bak character varying(4000) NOT NULL,
    name character varying(255) NOT NULL
);


CREATE INDEX ds_gis_device_id_code_idx ON gdm.gdm_gis_device USING btree (id, code);
CREATE INDEX ds_gis_device_lon_lat_idx ON gdm.gdm_gis_device USING btree (lon, lat);
CREATE UNIQUE INDEX pk_ds_gis_device ON gdm.gdm_gis_device USING btree (id);

COMMENT ON COLUMN gdm_gis_device.id IS 'id';
COMMENT ON COLUMN gdm_gis_device.code IS 'gps编号';
COMMENT ON COLUMN gdm_gis_device.type IS '设备类型';
COMMENT ON COLUMN gdm_gis_device.is_gps IS '是否为定位设备';
COMMENT ON COLUMN gdm_gis_device.lon IS '经度';
COMMENT ON COLUMN gdm_gis_device.lat IS '纬度';
COMMENT ON COLUMN gdm_gis_device.speed IS '速度';
COMMENT ON COLUMN gdm_gis_device.angle IS '方向';
COMMENT ON COLUMN gdm_gis_device.altitude IS '高程';
COMMENT ON COLUMN gdm_gis_device.gps_time IS 'gps时间';
COMMENT ON COLUMN gdm_gis_device.receive_time IS '接收时间';
COMMENT ON COLUMN gdm_gis_device.save_time IS '入库时间';
COMMENT ON COLUMN gdm_gis_device.operator IS '操作用户';
COMMENT ON COLUMN gdm_gis_device.valid IS '有效性,0-无效,1-有效';
COMMENT ON COLUMN gdm_gis_device.create_time IS '创建时间';
COMMENT ON COLUMN gdm_gis_device.update_time IS '更新时间';
COMMENT ON COLUMN gdm_gis_device.geom IS '空间字段';
COMMENT ON COLUMN gdm_gis_device.coords IS '最近坐标点';
COMMENT ON COLUMN gdm_gis_device.bak IS 'bak';
COMMENT ON COLUMN gdm_gis_device.name IS '设备名称';

